import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import dataFake from "../../../../dataFake";

const Home = ({ products }) => {
  return (
    <div className="container">
      <div id="content" className="space-top-none">
        <div className="main-content">
          <div className="space60">&nbsp;</div>
          <div className="row">
            <div className="col-sm-12">
              <div className="beta-products-list">
                <h4>New Products</h4>
                <div className="row">
                  {dataFake.map((products, index) => (
                    <div className="col-sm-3" key={index}>
                      <div className="single-item">
                        <div className="single-item-header">
                          <a>
                            <img src={products.image} height="100" alt="" />
                          </a>
                        </div>
                        <div className="single-item-body">
                          <p className="single-item-title">{products.name}</p>
                          <p className="single-item-price">
                            <span>${products.price}</span>
                          </p>
                        </div>
                        <div className="single-item-caption">
                          <a
                            className="add-to-cart pull-left"
                            href="shopping_cart.html"
                          >
                            <i className="fa fa-shopping-cart" />
                          </a>
                          <Link to={"/detail/" + products.id}>
                            <a className="beta-btn primary">
                              Details <i className="fa fa-chevron-right" />
                            </a>
                          </Link>

                          <div className="clearfix" />
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              </div>{" "}
              {/* .beta-products-list */}
            </div>
          </div>{" "}
          {/* end section with sidebar and main content */}
        </div>{" "}
        {/* .main-content */}
      </div>{" "}
      {/* #content */}
    </div>
  );
};

Home.propTypes = {};

export default Home;
